  [],\n\t\"revision_timestamp\": \"2015-05-07T01:21:36.061198\",\n\t\"name\": \"platform-independent-launch-vehicle-avionics-with-gps-metric-tracking-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"For this award, Tyvak proposes to develop
  a complete suite of avionics for a Nano-Launch Vehicle (NLV) based on the architecture
  determinations performed during Phase I. This system will address the unique avionics
  challenges of a dedicated small launch vehicle and will utilize heritage and lessons
  learned from Tyvak's CubeSat avionics systems, modifying and optimizing its existing
  products for use with this new class of launch vehicles. The major technical objectives
  are: rn- Provide broad compatibility with all known NLV systems in development rn-
  Determine and provide appropriate performance and reliability metrics while maintaining
  the low-cost/low-mass approach made possible by commercial electronic systems rn-tImplement
  the latest network protocols with support for wireless systems in the NLV environment
  rn- Develop a GPS metric tracking system and perform requirement verification to
  meet  range safety recommendationsrn- Demonstrate the reliability of low-cost/low-mass/low-power/redundant
  automatic flight termination system (AFTS) by combining the latest generation of
  commercial miniature GPS systems with high performance computer systems currently
  used by Tyvakrn- Validate functionality and performance for the entire NLV avionics
  suite through a series of incremental tests, from vibration and thermal vacuum,
  through a stratospheric balloon flight, an inert test article flight, to final demonstration
  on a NLV proxy.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
